<!DOCTYPE html>
<html lang="en">
<head>
	<script language="JavaScript">
	var howMany = 1;
	var page = new Array(howMany+1);

	page[0]="https://script.google.com/macros/s/AKfycbw2xbXbeoNKqtn1VgYKGjCsZaV2r07fSRub9WGGLm-3Z4enYWJm/exec";
	page[1]="https://script.google.com/macros/s/AKfycbzwIvj-GU-TRROGcVy9ezeAkNSVZBwZdsD3cToj2EvQiNUklJXe/exec";

	function rndnumber(){
		var randscript = -1;
		while (randscript < 0 || randscript > howMany || isNaN(randscript)){
			randscript = parseInt(Math.random()*(howMany+1));
		}
		return randscript;
	}
	quo = rndnumber();
	quox = page[quo];
	window.location=(quox);
	</script>
